sys_variable_value.value:
(function execute(inputs, outputs) {
	var utils = new AzureTrafficManagerUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ['name']);
  	var payload = {};
   	if(inputs.name)
    	payload.name = inputs.name;
  	payload.type = "microsoft.network/trafficmanagerprofiles";
   	outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

